    public static int countMatrixPairs(int N) {
        List<int[][]> possibleAs = generatePossibleMatrices(N);
        List<int[][]> possibleBs = generatePossibleMatrices(N);

        int count = 0;
        int[][][] C = new int[1 << (N * N)][N][N];

        for (int[][] A : possibleAs) {
            for (int[][] B : possibleBs) {
                int[][] product = multiplyMatrices(A, B, N);

                boolean valid = true;
                for (int i = 0; i < N; i++) {
                    for (int j = 0; j < N; j++) {
                        if (product[i][j] != 0 && product[i][j] != 1) {
                            valid = false;
                            break;
                        }
                    }
                    if (!valid) break;
                }

                if (valid) {
                    count = (count + 1) % MOD;
                }
            }
        }

        return count;
    }

    static List<int[][]> generatePossibleMatrices(int N) {
        List<int[][]> matrices = new ArrayList<>();
        int totalMatrices = 1 << (N * N);

        for (int mask = 0; mask < totalMatrices; mask++) {
            int[][] matrix = new int[N][N];
            for (int i = 0; i < N; i++) {
                for (int j = 0; j < N; j++) {
                    matrix[i][j] = (mask >> (i * N + j)) & 1;
                }
            }
            matrices.add(matrix);
        }

        return matrices;
    }

    static int[][] multiplyMatrices(int[][] A, int[][] B, int N) {
        int[][] result = new int[N][N];

        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                for (int k = 0; k < N; k++) {
                    result[i][j] ^= A[i][k] & B[k][j];
                }
            }
        }

        return result;
    }

