                if (dp[i][mask] != 0) {
                    for (int nextMask = 0; nextMask < (1 << n); nextMask++) {
                        if (isValidMask(n, C, i, mask, nextMask)) {
                            dp[i + 1][nextMask] = (dp[i + 1][nextMask] + dp[i][mask]) % MOD;
